function gerarPDF() {
    const { jsPDF } = window.jspdf;
    const doc = new jsPDF();

        // Pegar os valores preenchidos no formulário
    const nomeDaOM = document.getElementById('om-responsavel').value;
    const tipoEmbarcacao = document.getElementById('tipos-de-embarcacoes').value;
    const armador = document.getElementById('nome-do-armador').value;
    const construtor = document.getElementById('nome-do-construtor').value;
    const nomeEmbarcacao = document.getElementById('nome-da-embarcacao').value;
    const portoInscricao = document.getElementById('porto-de-inscricao').value;
    const materialDoCasco = document.getElementById('material-do-casco').value;
    const anoConstrucao = document.getElementById('ano-construcao').value;
    const tipoNavegacao = document.getElementById('tipos-de-navegacao').value;
    const numeroInscricao= document.getElementById('numero-inscricao').value
    const Hc = document.getElementById("calado-carregado").value;
    const Hl = document.getElementById("calado-leve").value;
    const Dc = document.getElementById("deslocamento-carregado").value;
    const Dl = document.getElementById("deslocamento-leve").value;
    const Pb = document.getElementById("porte-bruto").value;
    const numeroTripulantes = document.getElementById("numero-tripulantes").value;
        //const N1 = document.getElementById("N1").value;
        //const N2 = document.getElementById("N2").value;
    const M = document.getElementById("M-convencional").value;
    const V1 = document.getElementById("v1").value;
    const V2 = document.getElementById("v2").value;
    const V = document.getElementById("volume-total-arq-bruta").value;
    const K1 = document.getElementById("k1").value;
    const arqueacaoBruta = document.getElementById("arqueacao-bruta").value;
    const espacosCarga = document.getElementById("espacos-carga-arq-liq").value;
    const Vc = document.getElementById("espacos-carga-arq-liq").value;
    const K2 = document.getElementById("k2").value;
    const N1N2 = document.getElementById("n1-n2").value;
    const formulaArqLiq = document.getElementById('formula-arq-liq').value;
    const formula2ArqLiq = document.getElementById('formula2-arq-liq').value;
    const formula3ArqLiq = document.getElementById('formula3-arq-liq').value;
    const AL30AB = document.getElementById("formula4-arq-liq").value;
    const N1_1 = document.getElementById('numero-passageiros-beliches').value;
    const N2_1 = document.getElementById('numero-demais-passageiros').value;
    const ArqLiqFinal = document.getElementById("arqueacao-liquida").value;
    const data = document.getElementById("dataField").value;
    const textoLivre = document.getElementById("textoLivre").value;
    const margemDireita = 190; // Ajuste de acordo com a largura da página
    const alturaPagina = doc.internal.pageSize.height;
    const margemEsquerdaAssinatura = 100;
    const margemInferiorAssinatura = alturaPagina - 20;
    const posto = document.getElementById("postoResponsavel").value;
    const funcao = document.getElementById("funcaoResponsavel").value;
    const nomeResponsavel = document.getElementById("nomeResponsavel").value;
    const larguraRetangulo = 180; // Largura do retângulo / Aqui crio um retangulo para observacoes
    const alturaRetangulo = 25; // Altura do retângulo



        //Definindo o NARQ
        const margemDireitaNarq = doc.internal.pageSize.width - 15;
        let posYIdentificacao = 10; // Margem superior
        const fonteTamanho = 9; 

        doc.setFont("helvetica", "normal");
        doc.setFontSize(fonteTamanho);

        // Pega os valores dos elementos de identificação
        const narq = document.getElementById("omField").value || "-";
        const sequencialValue = document.getElementById("sequencialField").value || "-";
        const anoValue = document.getElementById("anoField").value || "-";
        const horaValue = document.getElementById("horaField").value || "-";

        // Formata a linha de identificação com espaços entre os valores
        const identificacao = `${narq}NARQ${sequencialValue}/${anoValue}`;

        // Define o posX inicial para alinhar a identificação à direita
        const posXIdentificacao = margemDireita - doc.getTextWidth(identificacao);

        // Adiciona a identificação no topo da página
        doc.text(identificacao, posXIdentificacao, posYIdentificacao);


        //Definindo o Cabeçalho da Pagina
        // Configurações de estilo
        doc.setFontSize(10);  // Define o tamanho da fonte
        const margemEsquerda = 20;
        let posY = 6;
        const logoBase64 = "data:image/png;base64,";
        const imgWidth = 20; // largura da imagem
        const imgHeight = 19; // altura da imagem
        const centerX = (doc.internal.pageSize.width - imgWidth) / 2;

        doc.addImage(logoBase64, "PNG", centerX, posY, imgWidth, imgHeight);
        posY += imgHeight + 5; // atualiza o posY para evitar sobreposição

        // Centralizar o cabeçalho
        doc.setFontSize(10); // Cabeçalho maior
        doc.setFont("helvetica", "bold");
        doc.text("MARINHA DO BRASIL", doc.internal.pageSize.width / 2, posY, { align: "center" });
        posY += 5;
        doc.text(`${nomeDaOM.toUpperCase()}`, doc.internal.pageSize.width / 2, posY, { align: "center" });
        posY += 7;
        doc.text("NOTAS PARA ARQUEAÇÃO DE EMBARCAÇÕES", doc.internal.pageSize.width / 2, posY, { align: "center" });
        posY += 5;
        doc.text("COMPRIMENTO DE REGRA (L) MENOR QUE 24 METROS", doc.internal.pageSize.width / 2, posY, { align: "center" });
        posY += 11;

        // Características Gerais (negrito)
        doc.setFontSize(10);
        doc.setFont("helvetica", "bold");
        doc.text("1. - CARACTERÍSTICAS GERAIS", margemEsquerda, posY);
        doc.setFont("helvetica", "normal");

        // Campos lado a lado com os valores preenchidos sublinhados
        posY += 8;
        const espaco = 30; // Espaço entre o texto e os valores
        const comprimentoLinha = 50; // Comprimento da linha sublinhada

        function verificarNovaPagina() {
                if (posY > 250) { // Valor ajustado para perto do final da página
                    doc.addPage();
                    posY = 20; // Reinicia a posição vertical na nova página
                }
            }


            doc.text(`NOME: ${nomeEmbarcacao}`, margemEsquerda, posY);
        doc.line(2 + espaco, posY + 1, margemEsquerda + espaco + comprimentoLinha, posY + 1); // Linha para NOME

        doc.text(`MATERIAL DO CASCO: ${materialDoCasco}`, margemEsquerda + 85, posY);
        doc.line(113 + espaco, posY + 1, 113 + espaco + comprimentoLinha, posY + 1); // Linha para TIPO

        posY += 7;
        doc.text(`ARMADOR: ${armador}`, margemEsquerda, posY);
        doc.line(10 + espaco, posY + 1, margemEsquerda + espaco + comprimentoLinha, posY + 1); // Linha para ARMADOR

        doc.text(`TIPO DE NAVEGAÇÃO: ${tipoNavegacao}`, margemEsquerda + 85, posY);
        doc.line(114 + espaco, posY + 1, 114 + espaco + comprimentoLinha, posY + 1); // Linha para CLASSIFICAÇÃO

        posY += 7;
        doc.text(`CONSTRUTOR: ${construtor}`, margemEsquerda, posY);
        doc.line(15 + espaco, posY + 1, margemEsquerda + espaco + comprimentoLinha, posY + 1); // Linha para 

        //Recuperando os valores de atividade ou serviço
        function getSelectedValues() {
            const checkboxes = document.querySelectorAll('#atividade-servico-dropdown input[type="checkbox"]');
            const selectedValues = [];

            checkboxes.forEach(checkbox => {
                if (checkbox.checked) {
                    selectedValues.push(checkbox.value);
                }
            });

        return selectedValues.join(', '); // Junta os valores em uma string separada por vírgulas
        }

        const atividadeServico = getSelectedValues();

        doc.text(`ATIVIDADE/SERVIÇO: ${atividadeServico}`, margemEsquerda + 85, posY);
        doc.line(115 + espaco, posY + 1, 120 + espaco + comprimentoLinha, posY + 1); // Linha para PORTO DE INSCRIÇÃO

        posY += 7;
        doc.text(`PORTO DE INSCRIÇÃO: ${portoInscricao}`, margemEsquerda, posY);
        doc.line(33 + espaco, posY + 1, margemEsquerda + espaco + comprimentoLinha, posY + 1);

        doc.text(`TIPO DE EMBARCAÇÃO: ${tipoEmbarcacao}`, margemEsquerda + 85, posY);
        doc.line(116 + espaco, posY + 1, 120 + espaco + comprimentoLinha, posY + 1);

        posY += 7;
        doc.text(`ANO DE CONSTRUÇÃO: ${anoConstrucao}`, margemEsquerda + 85, posY);
        doc.line(margemEsquerda + 95 + espaco, posY + 1, margemEsquerda + 95 + espaco + comprimentoLinha, posY + 1); 

        doc.text(`NÚMERO DE INSCRIÇÃO: ${numeroInscricao}` , margemEsquerda, posY);
        doc.line(33 + espaco, posY + 1, margemEsquerda + espaco + comprimentoLinha, posY + 1);
        // Linha para ANO DE CONSTRUÇÃO

        posY += 10;
        doc.text("Ct = _________ m", margemEsquerda + 35, posY);
        doc.text("P = _____________ m", margemEsquerda + 90, posY);

        posY += 8;
        doc.text(`L  = _________ m`, margemEsquerda + 35, posY);
        doc.text("B = _____________ m", margemEsquerda + 90, posY);

        posY += 8;
        doc.text("Lpp = _________ m", margemEsquerda + 35, posY);
        doc.text("Co = _____________ m", margemEsquerda + 90, posY);

        posY += 8;
        doc.text("Ca = _________ m", margemEsquerda + 35, posY);
        doc.text("H = _____________ m", margemEsquerda + 90, posY);

      // Campos Hc e Hl
    posY += 8;
    doc.text(`Hc (Calado carregado): ${Hc}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 37, posY + 1, margemEsquerda + 25 + 37, posY + 1); // Linha para Hc

    posY += 8;
    doc.text(`Hl (Calado leve): ${Hl}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 27, posY + 1, margemEsquerda + 25 + 27, posY + 1); // Linha para Hl

    // Campos Dc, Dl, Pb, Número de Tripulantes
    posY += 8;
    doc.text(`Dc (Deslocamento Carregado): ${Dc}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 49, posY + 1, margemEsquerda + 25 + 49, posY + 1); // Linha para Dc

    posY += 8;
    doc.text(`Dl (Deslocamento Leve): ${Dl}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 39, posY + 1, margemEsquerda + 25 + 39, posY + 1); // Linha para Dl

    posY += 8;
    doc.text(`Pb (Porte Bruto): ${Pb}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 27, posY + 1, margemEsquerda + 25 + 27, posY + 1); // Linha para Pb

    posY += 8;
    doc.text(`Número de Tripulantes: ${numeroTripulantes}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 37, posY + 1, margemEsquerda + 25 + 37, posY + 1); // Linha para Número de Tripulantes

    // Campos N1 e N2
    posY += 8;
    doc.text(`N1 (Número de passageiros em camarotes com até 8 beliches): ${N1_1}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 100, posY + 1, margemEsquerda + comprimentoLinha + 100, posY + 1); // Linha para N1

    posY += 8;
    doc.text(`N2 (Número dos demais passageiros): ${N2_1}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 61, posY + 1, margemEsquerda + comprimentoLinha + 61, posY + 1); // Linha para N2

    // Seção 2: Arqueação Bruta
    posY += 12;
    doc.setFont("helvetica", "bold");
    doc.text("2. - ARQUEAÇÃO BRUTA", margemEsquerda, posY);
    doc.setFont("helvetica", "normal");

    posY += 10;
    doc.text(`Com B + Co, calcule ou obtenha da Tabela do Anexo 7-F, M = ${M}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 97, posY + 1, margemEsquerda + 20 + 97, posY + 1); // Linha para B + Co
    verificarNovaPagina();

    posY += 9;
    doc.text(`V1 (Volume dos Espaços Fechados abaixo do Convés Superior) = Ca x M = ${V1}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 119, posY + 1, margemEsquerda + 20 + 119, posY + 1); // Linha para M
    verificarNovaPagina();

    posY += 9;
    doc.text(`V2 (Volume dos Espaços Fechados acima do Convés Superior) = ${V2}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 103, posY + 1, margemEsquerda + 20 + 103, posY + 1); // Linha para V1
    verificarNovaPagina();

    posY += 9;
    doc.text(`V (Volume de todos os Espaços Fechados, sem considerar os Espaços Excluídos) = V1+V2 = ${V}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 147, posY + 1, margemEsquerda + 20 + 147, posY + 1); // Linha para V2
    verificarNovaPagina();

    posY += 9;
    doc.text(`Com V, calcule ou obtenha da Tabela do Anexo 7-E, K1 = ${K1}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 91, posY + 1, margemEsquerda + 20 + 91, posY + 1); // Linha para V
    verificarNovaPagina();

    posY += 9;
    doc.text(`Arqueação Bruta = K1 x V = ${arqueacaoBruta}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 44, posY + 1, margemEsquerda + 20 + 44, posY + 1);
    verificarNovaPagina();

    posY += 1;
    doc.setFont("helvetica", "bold");
    doc.text("3. - ARQUEAÇÃO LÍQUIDA", margemEsquerda, posY);
    doc.setFont("helvetica", "normal");
    verificarNovaPagina();

    // Incrementa a posição vertical e insere o próximo texto
    posY += 7;
    doc.text(`a) Identifique os Espaços de Carga: ${espacosCarga}`, margemEsquerda, posY);
    verificarNovaPagina();

    posY += 7;
    doc.text(`b) Espaços de Carga (Vc)= ${Vc}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 43, posY + 1, margemEsquerda + 15 + 43, posY + 1);
    verificarNovaPagina();

    posY += 7;
    doc.text(`c) Com Vc, calcule ou obtenha da Tabela do Anexo 7-E, o valor de K²; K² = ${K2}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 118, posY + 1, margemEsquerda + 15 + 118, posY + 1);
    verificarNovaPagina();

    posY += 7;
    doc.text(`d) N1 + N2 = ${N1N2}`, margemEsquerda, posY);
    doc.line(margemEsquerda + 21, posY + 1, margemEsquerda + 15 + 21, posY + 1);
    posY += 10 - 5;  // Pequeno ajuste de espaçamento para subitens
    doc.text("  --> menor que 13, logo N1 e N2 nulos", margemEsquerda + 10, posY);
    posY += 10 - 5;
    doc.text("  --> maior ou igual a 13, usar N1 e N2", margemEsquerda + 10, posY);
    verificarNovaPagina();

    posY += 7;
    doc.text("e) Calcule as expressões das Notas:", margemEsquerda, posY);
    posY += 10 - 5;
    doc.text(`I) (4H / 3P)² = ${formulaArqLiq}`, margemEsquerda + 10, posY);
    doc.line(margemEsquerda + 31, posY + 1, margemEsquerda + 25 + 31, posY + 1);
    posY += 10 - 5;
    doc.text("  --> valor calculado menor ou igual a 1, usar o valor calculado.", margemEsquerda + 10, posY);
    posY += 10 - 5;
    doc.text("  --> valor calculado maior do que 1, usar a unidade.", margemEsquerda + 10, posY);
    posY += 10 - 5;
    doc.text(`II) K²Vc (4H / 3P)² = ${formula2ArqLiq}`, margemEsquerda + 10, posY);
    doc.line(margemEsquerda + 42, posY + 1, margemEsquerda + 25 + 42, posY + 1);
    posY += 10 - 5;
    doc.text("onde (4H / 3P)2 corresponde ao valor obtido em e) I)", margemEsquerda + 10, posY);
    posY += 10 - 5;
    doc.text("  --> valor calculado menor ou igual a 0,25 AB, usar 0,25 AB.", margemEsquerda + 10, posY);
    posY += 10 - 5;
    doc.text("  --> valor calculado maior do que 0,25 AB, usar o valor calculado.", margemEsquerda + 10, posY);
    posY += 10 - 5;
    doc.text(`III) 0,30 AB = ${AL30AB}`, margemEsquerda + 10, posY);
    doc.line(margemEsquerda + 31, posY + 1, margemEsquerda + 25 + 31, posY + 1);
    verificarNovaPagina();

    posY += 7;
    doc.text("f) Cálculo da Arqueação Líquida", margemEsquerda, posY);
    posY += 10 - 5;
    doc.text(`AL = K²Vc (4H / 3P)2 + (1,25 x ( AB + 10.000 ) / 10.000) x (N1 + ( N2 / 10 ))= ${formula3ArqLiq}`, margemEsquerda + 10, posY);
    doc.line(margemEsquerda + 131, posY + 1, margemEsquerda + 25 + 131, posY + 1);
    posY += 10 - 5;
    doc.text(`onde K²Vc (4H / 3P)² corresponde ao valor obtido em e) II)`, margemEsquerda + 10, posY);
    verificarNovaPagina();

    posY += 7;
    doc.text(`g) Comparar o valor obtido em e) III) (30% da arqueação bruta)`, margemEsquerda, posY);
    posY += 10 - 5;
    doc.text(`--> AL calculada maior ou igual a 30% AB, usar o valor calculado.) =`, margemEsquerda + 10, posY);
    doc.line(margemEsquerda + 117, posY + 1, margemEsquerda + 15 + 117, posY + 1);
    posY += 10 - 5;
    doc.text(`--> AL calculada menor que 30% AB, usar AL = 30 % AB.) =`, margemEsquerda + 10, posY);
    doc.line(margemEsquerda + 104, posY + 1, margemEsquerda + 15 + 104, posY + 1);
    verificarNovaPagina();

    // Ajusta a posição vertical para a seção de dados do motor
    posY += 12;
    doc.setFont("helvetica", "bold");
    doc.text("4. - DADOS DO(S) MOTOR(ES)", margemEsquerda, posY);
    doc.setFont("helvetica", "normal");
    verificarNovaPagina(); // Verifica se precisa pular para a próxima página

    const tabela = document.getElementById("tabela-dados-motores").getElementsByTagName("tbody")[0];
    const linhasTabela = tabela.getElementsByTagName("tr");

    // Define o deslocamento horizontal
    const deslocamentoX = 20; // Aumente este valor para mover a tabela mais à direita

    // Desenha o cabeçalho da tabela
    posY += 5;
    const colunasCabecalho = ["Fabricante", "Modelo", "Número de Série", "Potência (kW)", "RPM", "Combustível"];
    let posX = deslocamentoX; // Aplicando o deslocamento no cabeçalho
    const larguraColunas = [28, 28, 38, 28, 28, 28]; // Tabela mais compacta

    // Desenha os cabeçalhos em negrito
    doc.setFont("helvetica", "bold");
    for (let i = 0; i < colunasCabecalho.length; i++) {
        doc.rect(posX, posY, larguraColunas[i], 8); // Desenha o retângulo da célula do cabeçalho
        doc.text(colunasCabecalho[i], posX + 2, posY + 6); // Insere o texto do cabeçalho em negrito
        posX += larguraColunas[i];
    }
    doc.setFont("helvetica", "normal"); // Volta para o texto normal

    posY += 8; // Move para a próxima linha (conteúdo)

    // Verifica se há dados na tabela, se não houver, insere "-" em cada campo
    if (linhasTabela.length > 0) {
        // Caso haja dados, percorre as linhas da tabela
        for (let i = 0; i < linhasTabela.length; i++) {
            const celulas = linhasTabela[i].getElementsByTagName("td");
            posX = deslocamentoX; // Define a posição inicial horizontal com o deslocamento

            for (let j = 0; j < celulas.length; j++) {
                doc.rect(posX, posY, larguraColunas[j], 8); // Desenha a célula
                const valor = celulas[j].getElementsByTagName('input')[0]?.value || celulas[j].getElementsByTagName('select')[0]?.value || '-'; // Captura o valor da célula ou insere "-"
                doc.text(valor || "-", posX + 2, posY + 6); // Insere o valor ou "-" na célula
                posX += larguraColunas[j];
            }
            posY += 8; // Move para a próxima linha da tabela
            verificarNovaPagina(); // Verifica se precisa de uma nova página
        }
    } else {
        // Caso não haja dados, desenha três linhas vazias com "-"
        for (let i = 0; i < 3; i++) {
            posX = deslocamentoX; // Define a posição inicial horizontal com o deslocamento
            for (let j = 0; j < colunasCabecalho.length; j++) {
                doc.rect(posX, posY, larguraColunas[j], 8); // Desenha a célula
                doc.text("-", posX + 2, posY + 6); // Insere "-"
                posX += larguraColunas[j];
            }
            posY += 8; // Move para a próxima linha da tabela
            verificarNovaPagina(); // Verifica se precisa de uma nova página
        }
    }



    posY += 10;
    doc.text("Observações:", margemEsquerda, posY);
    doc.setFont("helvetica", "normal");

    if (textoLivre) {
    posY += 3; // Ajusta a posição vertical

    // Desenha o retângulo
    doc.setDrawColor(0); // Cor da borda do retângulo
    doc.setFillColor(255, 255, 255); // Cor de fundo do retângulo
    doc.rect(margemEsquerda, posY, larguraRetangulo, alturaRetangulo + 20, 'F'); // Aumenta a altura do retângulo
    doc.rect(margemEsquerda, posY, larguraRetangulo, alturaRetangulo + 20); // Desenha a borda do retângulo

    // Quebra o texto para caber dentro do retângulo
    const linhasTexto = doc.splitTextToSize(textoLivre, larguraRetangulo - 10); // -10 para margem interna

    // Define um novo valor para o espaçamento entre linhas
    const espacoEntreLinhas = 5; // Valor menor para diminuir o espaçamento

    // Adiciona o texto dentro do retângulo, com a posição ajustada
    linhasTexto.forEach((linha, index) => {
        doc.text(linha, margemEsquerda + 5, posY + 7 + (index * espacoEntreLinhas)); // Ajusta a altura com o novo espaçamento
        });
    }
    verificarNovaPagina();



    posY += 10 + 45;
    doc.text(`Local e Data: ${portoInscricao}, ${data}`, margemEsquerda, posY);


    // Renderiza a linha de assinatura no PDF
    doc.setLineWidth(0.5);
    doc.line(margemEsquerdaAssinatura, margemInferiorAssinatura, margemEsquerdaAssinatura + 80, margemInferiorAssinatura);

    // Define a posição inicial para o texto da assinatura e exibe o conteúdo
    let posYAssinatura = margemInferiorAssinatura - 2;
    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);

    // Imprime o ID do responsável, posto e função abaixo da linha de assinatura
    posYAssinatura += 6;
    doc.text(`${nomeResponsavel}`, margemEsquerdaAssinatura + 40, posYAssinatura, { align: "center" });
    posYAssinatura += 5;  // Ajusta o espaçamento vertical entre os textos
    doc.text(`${posto}`, margemEsquerdaAssinatura + 40, posYAssinatura, { align: "center" });
    posYAssinatura += 5;
    doc.text(`${funcao}`, margemEsquerdaAssinatura + 40, posYAssinatura, { align: "center" });


    // Finalize e gere o PDF
    doc.save("formulario-arqueacao.pdf");
}
